import React from 'react';

function ConsultationList({ consultations }) {
  return (
    <ul>
      {consultations.map((consultation) => (
        <li key={consultation._id}>
          <h3>{consultation.studentName}</h3>
          <p>{consultation.course}</p>
          <p>{new Date(consultation.consultationDate).toLocaleString()}</p>
          <p>{consultation.details}</p>
        </li>
      ))}
    </ul>
  );
}

export default ConsultationList;
